import React from "react";

const House = () => (
  <svg
  className='house'
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 39 37"
    width="39"
    height="37"
  >
    <defs>
      <image
        id="house"
        width="75"
        height="72"
        href="data:image/svg+xml;base64,"
      />
    </defs>
    <use
      id="icon-house.svg"
      transform="matrix(0.5 0 0 0.5 0.819 0.133)"
      href="#house"
    />
  </svg>
);
export default House;
